import React from 'react';
import Link from "next/link";
import Layout from "../components/myLayout";

export default function About() {
    return (
        <>
            <Layout>
            <h2>Created By: </h2>
            <h3>Daniel</h3>
            <h3>Adam</h3>
            <h3>Sam</h3>
            <h3>Nazim</h3>
            </Layout>
        </>
    )
}
